import InputForm from "../../UI/InputForm";
import classes from "./MealForm.module.css";
const MealForm = (props) => {
  return (
    <form className={classes.form}>
     <InputForm label='amount' input={{
         id:'Amount',
         type:'number',
         min:'1',
         max:'5',
         step:'1',
         defaultValue:'1'
     }}></InputForm>
     <button>Add</button>
    </form>
  );
};
export default MealForm;
